import React from 'react';

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items,
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells,
    runes,
    participants,
    version
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const outcomeColor = win ? 'var(--win-color)' : 'var(--loss-color)';
  const matchBgColor = win ? 'rgba(118, 200, 147, 0.1)' : 'rgba(230, 57, 70, 0.1)';

  const performanceLabel = (kills, deaths, assists) => {
    const kda = (kills + assists) / (deaths === 0 ? 1 : deaths);
    if (kda > 5) return 'MVP';
    if (win) return 'Leader';
    return 'Average';
  };

  const label = performanceLabel(kills, deaths, assists);

  const championImage = (
    <img
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
      alt={`${champion}`}
      className="champion-image"
      style={{ borderRadius: '50%', marginRight: '15px', width: '60px', height: '60px' }}
    />
  );

  const itemImages = items
    .filter(itemId => itemId > 0)
    .map((itemId, index) => (
      <img
        key={`${itemId}-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/item/${itemId}.png`}
        alt={`Item ${itemId}`}
        className="item-image"
        style={{ width: '40px', height: '40px', marginRight: '5px', borderRadius: '5px' }}
      />
    ));

  // Summoner spells (use spell images from data dragon)
  const spellImages = summonerSpells.map((spellName, index) => (
    <img
      key={`spell-${spellName}-${index}`}
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/${spellName}.png`}
      alt={`Spell ${spellName}`}
      className="summoner-spell-image"
      style={{ width: '30px', height: '30px', marginRight: '5px' }}
    />
  ));

  // Runes (display rune icons, using a placeholder for this example)
  const runeImages = runes.map((runeStyle, index) => (
    <img
      key={`rune-${index}`}
      src={`https://ddragon.leagueoflegends.com/cdn/img/${runeStyle.selections[0].perk}.png`}
      alt={`Rune ${runeStyle.style}`}
      className="rune-image"
      style={{ width: '30px', height: '30px', marginRight: '5px' }}
    />
  ));

  // Participant information: displaying each participant's champion and summoner name
  const participantDetails = participants.map((participant, index) => (
    <div key={`participant-${index}`} style={{ display: 'flex', alignItems: 'center', marginBottom: '5px' }}>
      <img
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`}
        alt={participant.championName}
        className="participant-champion-image"
        style={{ width: '30px', height: '30px', marginRight: '10px', borderRadius: '50%' }}
      />
      <span>{participant.summonerName}</span>
    </div>
  ));

  return (
    <div className="card match" style={{ borderLeft: `8px solid ${outcomeColor}`, backgroundColor: matchBgColor }}>
      <div style={{ display: 'flex', alignItems: 'center', paddingBottom: '10px' }}>
        {championImage}
        <div style={{ display: 'flex', flexDirection: 'column', gap: '4px' }}>
          <h4 style={{ margin: 0, color: outcomeColor }}>{matchOutcome}</h4>
          <p style={{ margin: 0, fontSize: '0.9em', color: 'var(--text-light)' }}>
            {kills}/{deaths}/{assists} K/D/A
          </p>
          <p style={{ margin: 0, fontSize: '0.8em', color: 'var(--text-light)' }}>
            Duration: {gameDuration}
          </p>
        </div>
      </div>
      <div className="summoner-spells">
        <strong style={{ color: 'var(--highlight-yellow)' }}>Summoner Spells:</strong> {spellImages}
      </div>
      <div className="runes">
        <strong style={{ color: 'var(--highlight-yellow)' }}>Runes:</strong> {runeImages}
      </div>
      <div className="item-images">
        <strong style={{ color: 'var(--highlight-yellow)' }}>Items:</strong> {itemImages}
      </div>
      <div className="participants" style={{ marginTop: '10px' }}>
        <h5 style={{ color: 'var(--highlight-yellow)' }}>Participants:</h5>
        {participantDetails}
      </div>
      <div style={{ marginTop: '10px' }}>
        <span
          style={{
            backgroundColor: win ? 'var(--highlight-yellow)' : 'var(--neutral-color)',
            color: win ? 'var(--text-dark)' : 'var(--text-light)',
            padding: '5px 10px',
            borderRadius: '5px',
            fontWeight: 'bold',
          }}
        >
          {label}
        </span>
      </div>
    </div>
  );
}

export default Match;
